	[3] = {engine = 0, leaveLimit = 4, prop = {}, name = "守护和平", enemyPower = 3510, timeLimit = 5, condition = 0, information = "龙珠不幸被恶势力所夺，他们想依靠龙珠称霸地球。为了保护地球，龙珠战士只得一战再战，才能夺回龙珠，保卫地球！燃烧吧！赛亚人之魂！", reward = 0, }, 
	[4] = {engine = 0, leaveLimit = 4, prop = {}, bossInfo = "Lv15.比克大魔王", name = "大战比克", enemyPower = 4030, timeLimit = 3, condition = 0, information = "那美克星至高无上的存在，地狱撒旦留在人间的化身，他就是比克大魔王！为了阻止比克魔王毁灭地球的野心，高傲的龙珠战士只能挥洒热血，为和平而战！", reward = 0, }, 
	[5] = {engine = 0, leaveLimit = 4, prop = {}, name = "新的对手", enemyPower = 4550, timeLimit = 5, condition = 0, information = "战败比克之后，又有新的恶势力看中了了龙珠的魔力。这样腥风血雨的征程究竟何时是头？但，我们龙珠战士只有一个目标！集齐龙珠，召唤神龙，保卫和平！", reward = 0, }, 
	[6] = {engine = 0, leaveLimit = 4, prop = {}, name = "无限拓展", enemyPower = 5070, timeLimit = 5, condition = 0, information = "龙珠的魔力吸引了外星民族的来临，邪恶的外星民族带着无与伦比的破坏力残杀苍生，掠夺龙珠。", reward = 0, }, 
	[7] = {engine = 0, leaveLimit = 4, prop = {}, name = "风起云涌", enemyPower = 5590, timeLimit = 5, condition = 0, information = "在与恶势力的交战中，伟大的龙珠战士天津饭和饺子不幸牺牲，为了复活战士，集齐龙珠迫在眉睫！", reward = 0, }, 
	[8] = {engine = 0, leaveLimit = 4, prop = {}, name = "为了伙伴", enemyPower = 6110, timeLimit = 5, condition = 0, information = "恶势力结成联盟，共同对付龙珠战士。三星珠不慎落入恶势力手中，为了复活同伴，战火一触即发！", reward = 0, }, 
	[9] = {engine = 0, leaveLimit = 4, prop = {}, name = "一战再战", enemyPower = 7020, timeLimit = 5, condition = 0, information = "不甘失败的恶势力联盟对龙珠发起了第二次争夺。面对兵力强大的恶势力联盟，龙珠战士抱着永不言败的信念，欣然迎战！", reward = 0, }, 
	[10] = {engine = 0, leaveLimit = 4, prop = {}, name = "召唤神龙", enemyPower = 7930, timeLimit = 5, condition = 0, information = "在召唤神龙的关键时刻，恶势力联盟再次发起挑战，而赛亚人别无选择，只能迎战，因为只有胜利才能召唤神龙，复活同伴！", reward = 0, }, 
	[11] = {engine = 0, leaveLimit = 4, prop = {}, bossInfo = "Lv45.宇宙帝王弗利萨", name = "魔王降临", enemyPower = 10725, timeLimit = 3, condition = 0, information = "臣服于宇宙魔王的赛亚人，在认清魔王佛利萨的真实面目后，毅然决然与之对战。为了宇宙的未来，赌上赛亚人的尊严，一定要消灭魔王，夺回龙珠！", reward = 0, }, 
	[12] = {engine = 0, leaveLimit = 4, prop = {}, name = "危机再临", enemyPower = 11220, timeLimit = 5, condition = 0, information = "格鲁博士不断制造出新一代的人造人，面对战斗力越来越强的人造人，宇宙最强战士赛亚人必须突破自我极限，才能战胜人造人，阻止格鲁博士！", reward = 0, }, 
	[13] = {engine = 0, leaveLimit = 4, prop = {}, name = "最强人造人", enemyPower = 12540, timeLimit = 5, condition = 0, information = "在无数次实验后，格鲁博士终于制造出最强人造人，人造人18，战力甚至可以超过超级赛亚人。宇宙是否就此毁灭？不，赛亚人还没说可以，宇宙怎能毁灭？", reward = 0, }, 
	[14] = {engine = 0, leaveLimit = 4, prop = {}, name = "激烈混战", enemyPower = 13860, timeLimit = 5, condition = 0, information = "为了对抗实力强大的赛亚人，格鲁博士使出最后绝招，而消耗巨大的超级赛亚人能否抵抗的住这强大的战力指数？答案，由你决定！", reward = 0, }, 
	[15] = {engine = 0, leaveLimit = 4, prop = {}, name = "那美克星", enemyPower = 15180, timeLimit = 5, condition = 0, information = "为了复活遭到人造人攻击而牺牲的无辜人类，龙珠战士前往那美克星去寻找散落的龙珠，可惜再次遇上恶势力的阻拦，为了全人类的未来，上吧，赛亚人！", reward = 0, }, 
	[16] = {engine = 0, leaveLimit = 4, prop = {}, name = "梦想之神", enemyPower = 16500, timeLimit = 5, condition = 0, information = "集齐龙珠的龙珠战士们，再次遇到恶势力的阻拦。恶势力的愿望很简单：杀死龙珠战士称霸世界。恶势力的邪恶愿望能否实现？赛亚人说，不！", reward = 0, }, 
	[17] = {engine = 0, leaveLimit = 4, prop = {}, name = "西鲁游戏", enemyPower = 18216, timeLimit = 5, condition = 0, information = "回到地球的龙珠战士，接到了魔物西鲁的邀请参加西鲁武道会，若不能在规定时间内战胜敌人，便会连累无辜的人类。预知宇宙未来如何，赶紧变身迎战！", reward = 0, }, 
	[18] = {engine = 0, leaveLimit = 4, prop = {}, bossInfo = "Lv75.恐怖人造人西鲁", name = "目标西鲁", enemyPower = 19536, timeLimit = 3, condition = 0, information = "以吸收对手能力来增强自身能力的人造怪物西鲁，不断吸取宇宙能量，变大变强，宇宙面临毁灭危机。而能阻止它的，只有你，赛亚人！", reward = 0, }, 
	[19] = {engine = 0, leaveLimit = 4, prop = {}, name = "恢复地球", enemyPower = 20856, timeLimit = 5, condition = 0, information = "大战人造人西鲁虽最终获得胜利，但战斗的强大破坏力也使得地球破坏的千仓百孔，龙珠战士再次集齐七龙珠，向神龙许下愿望恢复地球原貌", reward = 0, }, 
	[20] = {engine = 0, leaveLimit = 4, prop = {}, name = "新的征程", enemyPower = 22440, timeLimit = 5, condition = 0, information = "龙珠战士的使命很简单，人死了就用龙珠去救。面对西鲁游戏遗留下的历史问题。伟大的龙珠战士再次踏上新的征程！", reward = 0, }, 
	[21] = {engine = 0, leaveLimit = 4, prop = {}, name = "为了人类", enemyPower = 24024, timeLimit = 5, condition = 0, information = "恶势力永远在龙珠战士即将胜利的时候出来干预。为了宇宙，为了人类，龙珠战士硬着头皮再一次打败了恶势力的攻击！", reward = 0, }, 
