	[30] = {engine = 0, leaveLimit = 4, prop = {}, name = "暗藏杀机", enemyPower = 36905, timeLimit = 5, condition = 0, information = "在外星寻找龙珠的时候，龙珠战士不幸又遇上了老冤家。命运总是惊人的相似，龙珠战士再次开始了新一轮的征战！", reward = 0, }, 
